To count the number of rectangles in the grid, we need to find all the '#' characters and group them into rectangles. We can use a breadth-first search (BFS) algorithm to do this.

Here is a Python solution for the problem:

```python
from collections import deque

def count_rectangles(grid):
    rows, cols = len(grid), len(grid[0])
    visited = [[False for _ in range(cols)] for _ in range(rows)]
    count = 0

    for row in range(rows):
        for col in range(cols):
            if grid[row][col] == '#':
                if not visited[row][col]:
                    count += 1
                    queue = deque([(row, col)])
                    visited[row][col] = True

                    while queue:
                        r, c = queue.popleft()

                        for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                            nr, nc = r + dr, c + dc

                            if 0 <= nr < rows and 0 <= nc < cols and grid[nr][nc] == '#':
                                if not visited[nr][nc]:
                                    queue.append((nr, nc))
                                    visited[nr][nc] = True

    return count

grid = [list(line) for line in open("input.txt").read().splitlines()]
print(count_rectangles(grid))
```

This code reads the grid from a file named "input.txt" and prints the total count of rectangles.

